import React from 'react'
import '../../App.css'
import Footer from '../Footer'

function Game() {
    return (
        <>
            <div className='hero-container'>
                <h1>Tic Tack Toe - Arsenal Edition</h1>
            </div>
            <Footer />
        </>
    )
}

export default Game;
